CLEO Redux provides an interface for manipulating custom text directly in JavaScript code. There is a static variable, named FxtStore with the following interface: declare interface FxtStore { /** * Inserts new text content in the script's fxt storage overwriting the previous content and shadowing static fxt with the same key * @param key GXT key that can be used in text commands (7 characters max) * @param value text content * @param [isGlobal] if true, the text affects global FXT storage */ insert(key: string, value: string, isGlobal?: boolean): void; /** * Removes the text content associated with the key in the local fxt storage * @param key GXT key * @param [isGlobal] if true, the text affects global FXT storage */ delete(key: string, isGlobal?: boolean): void;
} Using FxtStore you can create unique keys and values in the script and put it in local FXT storage. Each script owns a private storage and keys from one script will not conflict with other scripts. Also keys defined in the FxtStore shadow the same keys defined in static FXT files. Consider the example: custom.fxt: MY_KEY Text from FXT file custom.js: Text.PrintHelp("MY_KEY"); // this displays "Text from FXT file"
FxtStore.insert("MY_KEY", "Text from script");
Text.PrintHelp("MY_KEY"); // this displays "Text from script"
FxtStore.delete("MY_KEY");
Text.PrintHelp("MY_KEY"); // this displays "Text from FXT file" again The private FXT storage is not supported in The Trilogy, Bully and GTA IV. Each script there modifies the global FXT storage. This behavior may change in the future. insert and delete methods can be forced to change global FXT keys even when the current host supports a private storage. By setting the last argument isGlobal to true you can mutate (add or delete) keys in the global storage. It might be helpful to deal with those keys that the game uses after procesing all scripts in a given frame (e.g. in delayed messages or HUD elements text) when the script's private storage is not available. Custom text can be constructed dynamically, e.g.: while (true) { wait(0); FxtStore.insert("TIME", "Timestamp: " + Date.now()); Text.PrintHelp("TIME"); // this displays "Timestamp: " and the updated timestamp value
}

