There is so little fun in a single script, so let's explore another important aspect. CLEO Redux can load and run many scripts concurrently. But they do not run in parallel, or at the same time. Instead there is a queue of scripts to execute them sequentually on each game loop iteration. It reduces a number of possible issues caused due to the use of shared resources from multiple parallel scripts. The game's main loop is also locked while CLEO scripts get processed. When the script is ready to return control to the main script or another script in the queue, it must call the wait(n) command where n is a number greater than or equal to zero. This command pauses the current script for at least n milliseconds: wait(250); // pause current script and wake up after 250 milliseconds Low values (such as 0 or generally anything lower than 16) essentially make the script run on each tick of the game's main loop. Let's create another JS file in the CLEO directory and call it second.js. Add the following lines: wait(1000);
log("This is the second script"); Save the file and re-run the game. You should now see two lines in the cleo_redux.log: 10:12:19 [INFO] ["intro"] "Hello world"
10:12:20 [INFO] ["second"] "This is the second script" Notice that there is a difference in one second between two messages. Try different combinations of log and wait commands in both scripts and see the results. Do they match your expectations?

