So far we have been running commands in the script in a sequence from top to bottom. The runtime executed the first line, then proceed to the second line if there was one, then to the third line, etc. But what if we want to execute a command only when some condition is met, lets say a button is pressed? We can use conditions. In JavaScript an if statement allows to conditionally execute a branch of code if the condition is met. For example, when you write: if (true) { log("this is always printed");
} You always get the log line printed since the condition in if always evaluates to true. Likewise if (false) { log("this will never be printed");
} when the condition evaluates to false inside the if block does not run so you won't see the log messages. You can have any expression in the if statement. JavaScript runtime will try its best to convert it to a boolean (simply saying, convert to true or false). Here are some examples of expressions that get evaluated to true (they are called truthy): if (1) {...}
if ("string") {...}
if (5 > 4) {...}
if ([]) {...}
if ({}) {...} Note that 0 and an empty string always get evaluated to false (they are "falsy" values): if (0) {...}
if ("") {...} Of course you can have complex experession like functions or methods calls inside the if condition: if ("string".length > 0) {...}
if ([1,2,3].includes(3)) {...}
if ( ({ status: 'open'}).status === 'open' ) {...} CLEO API has many conditional commands for different types of checks. For example, the Input plugin provides commands to check the user input (i.g. a check that the button is pressed). Go to intro.js and change its content to: // intro script, revision 2
wait(2000);
if (native("IS_KEY_PRESSED", 115)) { log("F4 button is pressed");
} Run the game. In cleo_redux.log you should not see the line "F4 button is pressed". Now try running it while holding the F4 button. A new log entry should appear. You can combine multiple conditions in the same if statement using && (AND) or || (or) operators : if (native("IS_KEY_PRESSED", 115) || native("IS_KEY_PRESSED", 116)) { log("Either F4 or F5 button is pressed");
} if (native("IS_KEY_PRESSED", 115) && native("IS_KEY_PRESSED", 116)) { log("Both F4 and F5 button are pressed");
} You can execute commands in else block if the condition is not met: if (native("IS_KEY_PRESSED", 115)) { log("F4 button is pressed");
} else { log("F4 button is not pressed");
}

