Dispatching events is a safe way for scripts to communicate with each other. For example, one script can dispatch an event when the player enters a specific area, and another script can listen to that event and perform some action. dispatchEvent function creates a new custom event. It has the following signature: function dispatchEvent(name: string, data: any): void; The name parameter is the name of the event to dispatch. It corresponds to the name argument in addEventListener. The data is an optional payload that will be passed to the event listeners as the data property of the event object. The payload can be any JSON-serializable value (e.g. functions are not allowed). // Dispatch an event from a script
dispatchEvent("OnMyCustomEvent", { foo: "bar" }); // Listen to the event in a script
addEventListener("OnMyCustomEvent", (event) => { log(event.data.foo); // logs "bar"
});

