Memory object allows to invoke a foreign (native) function by its address using one of the following methods: Memory.CallFunction - calls a function at the address and discards the returned value Memory.CallFunctionReturn - calls a function and at the address and returns an integer value Memory.CallFunctionReturnFloat - calls a function and at the address and returns a floating-point value Memory.CallMethod - calls a class instance method and discards the returned value Memory.CallMethodReturn - calls a class instance method and returns an integer value Memory.CallMethodReturnFloat - calls a class instance method and returns a floating-point value Memory.CallFunction(0x1234567, 2, 0, 1000, 2000); where 0x1234567 is the address of the function, 2 is the number of arguments, 0 is the pop parameter (see below), 1000 and 2000 are the two arguments passed into the function. Legacy SCM implementation of the call commands require the arguments of the invoked function to be listed in reverse order. That's it, you would see the same call in SCM as: 0AA5: call 0x1234567 num_params 2 pop 0 2000 1000 where 2000 is the second argument passed to the function located at 0x1234567 and 1000 is the first one. In JS code all input arguments go in the direct order. The third parameter (pop) in Memory.CallFunction defines the calling convention. When it is set to 0, the function is called using the stdcall convention. When it is set to the same value as numParam, the function is called using the cdecl convention. Any other value breaks the code. Memory.CallFunctionReturn has the same interface but additionally it writes the result of the function to a variable. Memory.CallMethod invokes a method of an object: Memory.CallMethod(0x2345678, 0x7001234, 2, 0, 1000, 2000); The second parameter (0x7001234) is the object address. The pop parameter is always 0 (the method uses the thiscall convention). To call the method and get the result out of it, use Memory.CallMethodReturn. Input arguments are treated as 32-bit signed integers. If you need to provide a floating-point number, use Memory.FromFloat, e.g. Memory.CallFunction(0x1234567, 1, 1, Memory.FromFloat(123.456)); CLEO Redux supports calling foreign functions with up to 16 parameters. The usage of any of the call methods requires the mem permission . Convenience methods with Fn object Memory.Fn provides a lot of convenient methods for calling different types of foreign functions. Fn: { Cdecl(address: int): (...funcParams: int[]) => int; CdeclFloat(address: int): (...funcParams: int[]) => float; CdeclI8(address: int): (...funcParams: int[]) => int; CdeclI16(address: int): (...funcParams: int[]) => int; CdeclI32(address: int): (...funcParams: int[]) => int; CdeclU8(address: int): (...funcParams: int[]) => int; CdeclU16(address: int): (...funcParams: int[]) => int; CdeclU32(address: int): (...funcParams: int[]) => int; Stdcall(address: int): (...funcParams: int[]) => int; StdcallFloat(address: int): (...funcParams: int[]) => float; StdcallI8(address: int): (...funcParams: int[]) => int; StdcallI16(address: int): (...funcParams: int[]) => int; StdcallI32(address: int): (...funcParams: int[]) => int; StdcallU8(address: int): (...funcParams: int[]) => int; StdcallU16(address: int): (...funcParams: int[]) => int; StdcallU32(address: int): (...funcParams: int[]) => int; Thiscall(address: int, struct: int): (...funcParams: int[]) => int; ThiscallFloat(address: int, struct: int): (...funcParams: int[]) => float; ThiscallI8(address: int, struct: int): (...funcParams: int[]) => int; ThiscallI16(address: int, struct: int): (...funcParams: int[]) => int; ThiscallI32(address: int, struct: int): (...funcParams: int[]) => int; ThiscallU8(address: int, struct: int): (...funcParams: int[]) => int; ThiscallU16(address: int, struct: int): (...funcParams: int[]) => int; ThiscallU32(address: int, struct: int): (...funcParams: int[]) => int; } These methods is designed to cover all possible function signatures. For example, this code Memory.CallMethod(0x2345678, 0x7001234, 2, 0, 1000, 2000); can also be written as Memory.Fn.Thiscall(0x2345678, 0x7001234)(1000, 2000); Note a few key differences here. First of all, Memory.Fn methods don't invoke a foreign function directly. Instead, they return a new JavaScript function that can be stored in a variable and reused to call the associated foreign function many times with different arguments: var myMethod = Memory.Fn.Thiscall(0x2345678, 0x7001234);
myMethod(1000, 2000); // calls method 0x2345678 with arguments 1000 and 2000
myMethod(3000, 5000); // calls method 0x2345678 with arguments 3000 and 5000 The second difference is that there are no numParams and pop parameters. Each Fn method figures them out automatically. By default a returned result is considered a 32-bit signed integer value. If the function returns another type (a floating-point value, or a signed integer), use one of the methods matching the function signature, e.g.: var flag = Memory.Fn.CdeclU8(0x1234567)(); This code invokes a cdecl function at 0x1234567 with no arguments and stores the result as a 8-bit unsigned integer value.

