Memory object allows to invoke a foreign (native) function by its address using one of the following methods: Memory.CallFunction - calls a function at the address and discards the returned value Memory.CallFunctionReturn - calls a function and at the address and returns an integer value Memory.CallFunctionReturnFloat - calls a function and at the address and returns a floating-point value Memory.CallFunction(0xeffb30, true, 1, 13); where 0xEFFB30 is the function offset relative to IMAGE BASE (think of it a randomized start address of the game memory), true is the ib flag (see below), 1 is the number of input arguments, and 13 are the only argument passed into the function. The ib parameter in Memory.CallFunction has the same meaning as in memory read/write commands. When set to true CLEO adds the current known address of the image base to the value provided as the first argument to calculate the absolute memory address of the function. When set to false no changes to the first argument are made. To pass floating-point values to the function, convert the value to integer using Memory.FromFloat: Memory.CallFunction(0x1234567, true, 1, Memory.FromFloat(123.456)); A returned value of the function called with Memory.CallFunction is ignored. To read the result use Memory.CallFunctionReturn that has the same parameters. Use Memory.CallFunctionReturnFloat to call a function that returns a floating-point value. CLEO Redux supports calling foreign functions with up to 16 parameters. The usage of any of the call methods requires the mem permission . Convenience methods with Fn object Memory.Fn provides convenient methods for calling different types of foreign functions. Fn: { X64(address: int, ib: boolean): (...funcParams: int[]) => int; X64Float(address: int, ib: boolean): (...funcParams: int[]) => float; X64I8(address: int, ib: boolean): (...funcParams: int[]) => int; X64I16(address: int, ib: boolean): (...funcParams: int[]) => int; X64I32(address: int, ib: boolean): (...funcParams: int[]) => int; X64U8(address: int, ib: boolean): (...funcParams: int[]) => int; X64U16(address: int, ib: boolean): (...funcParams: int[]) => int; X64U32(address: int, ib: boolean): (...funcParams: int[]) => int; } These methods is designed to cover all supported return types. For example, this code Memory.CallFunction(0xeffb30, true, 1, 13); can also be written as Memory.Fn.X64(0xeffb30, true)(13); Note a few key differences here. First of all, Memory.Fn methods don't invoke a foreign function directly. Instead, they return a new JavaScript function that can be stored in a variable and reused to call the associated foreign function many times with different arguments: var f = Memory.Fn.X64(0xeffb30, true);
